var env=new Primrose.BrowserEnvironment({font:"../shared_assets/fonts/helvetiker_regular.typeface.json",backgroundColor:458783,groundTexture:"../shared_assets/images/grass.png",useFog:!0,fullScreenButtonContainer:"#fullScreenButtonContainer",progress:Preloader.thunk}),treeReady=Primrose.Graphics.ModelFactory.loadModel("tree.obj");env.addEventListener("ready",function(){treeReady.then(function(e){for(var r=0;r<100;++r)e.clone().named("tree"+r).addTo(env.scene).at(Primrose.Random.number(-25,25),0,Primrose.Random.number(-25,25));Preloader.hide()})});